var controls=function(){

  this.add=function(prop){      //  Add
    switch (prop.t){
      case CONTROLS.UPDOWN:       app.controls.push(new upDown(prop));      break;
      case CONTROLS.NODE:         app.controls.push(new node(prop));        break;
      case CONTROLS.BUTTON:       app.controls.push(new button(prop));      break;
      case CONTROLS.BBUTTON:      app.controls.push(new bButton(prop));     break;
      case CONTROLS.TLBBUTTON:    app.controls.push(new tlbButton(prop));   break;
      case CONTROLS.RECEIVER:     app.controls.push(new receiver(prop));    break;
      case CONTROLS.TRANSMITTER:  app.controls.push(new transmitter(prop)); break;
      default: break;
    }
  };
  this.refresh=function(x,y)  { //  Refresh
   for(var ctl in app.controls)  { app.controls[ctl].refresh(x,y);  }
  };
  this.update=function(x,y)   { //  Update
   for(var ctl in app.controls)  { app.controls[ctl].update(x,y);   }
  };
  this.clicked=function(x,y)  { //  Click
   for(var ctl in app.controls)  { app.controls[ctl].clicked(x,y);  }
  };
  this.pressed=function(x,y)  { //  Pressed
   for(var ctl in app.controls)  { app.controls[ctl].pressed(x,y);  }
  };
  this.released=function(x,y) { //  Released
   for(var ctl in app.controls)  { app.controls[ctl].released(x,y); }
  };
  this.moved=function(x,y)    { //  Moved
   for(var ctl in app.controls)  { app.controls[ctl].moved(x,y);    }
  };  
  this.item=function(n)       { return app.controls[n];           };
  this.length=function()     {  return app.controls.length;     };

};

var controls=new controls();

var initialize=function(){

  var arr=[];
  var val=1;

  for(var row=0; row<babbage.length; row++){
    for(var col=0; col<babbage[row].length; col++){

      arr[col]=babbage[row][col];
      val++;
    }

    app.output[row]=arr;
    arr=[];
    val=row%2;

  }

  app.output=arr;
  
};

var fNoise=function(){

  app.mode=MODES.NOISE;

  app.table=[5,5,5,5];

  upd();

};

var loadBabbage=function(){
  
  var arr=[];
  
  for(var row=0; row<babbage.length; row++){
    for(var col=0; col<babbage[row].length; col++){
      arr[col]=babbage[row][col];
    }
    app.output[row]=arr;
    arr=[];
  }

};

var fReset=function(){

  app.mode=MODES.DEFAULT;
  app.table=[0,0,0,0];
  
  loadBabbage();

};

var fClick=function(n){

  app.mode=n;

  switch(app.mode){
    case MODES.NOT:     app.table=[2,2,2,2];  upd();    break;
    case MODES.XOR:     app.table=[0,1,1,0];  upd();    break;
    case MODES.AND:     app.table=[0,0,0,1];  upd();    break;
    case MODES.OR:      app.table=[1,1,1,0];  upd();    break;
    case MODES.DEFAULT: app.table=[0,0,0,0];  fReset(); break;    
    case MODES.NOISE:   app.table=[0,0,0,0];  fNoise(); break;    
  }

};

